import React, { Component } from 'react'
import './SASS/Main.scss'
// import Button from './Button'

export default class App extends Component {
  constructor() {
    super()
    this.state = {
      planets: []
    }
  }

  componentDidMount() {
    fetch('https://swapi.co/api/people/', {
      method: 'get',
      headers: { 'content-type': 'application/json' }
    })
      .then(data => {
        const newStateArray = []
        newStateArray.push(data.results)
        this.setState({ planets: newStateArray })
      })
      .then(console.log(this.state.planets))
      .catch(error => console.log(error))
  }

  render() {
    return (
      <div>
        <div className="logo">
          <img
            className="logo_image"
            src="https://proxy.duckduckgo.com/iu/?u=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F6%2F6c%2FStar_Wars_Logo.svg%2F1200px-Star_Wars_Logo.svg.png&f=1"
            alt="star wars logo"
          />
        </div>
        <p>Upvote your favorite characters.</p>
      </div>
    )
  }
}

